Verenigde Staten / Verenigd Koninkrijk / Spanje / Frankrijk
Komedie / Science-Fiction
104 minuten

geregisseerd door Greg Mottola
met Simon Pegg, Nick Frost en de stem van Seth Rogen

Graham en Clive (Simon Pegg &amp; Nick Frost) zijn twee vrienden die enorm gek zijn op stripboeken en vooral interesse hebben in science-fiction verhalen. Samen gaan ze op reis naar het UFO-centrum van Amerika, namelijk het beruchte ''Area 51'' in Nevada. Als ze midden in de woestijn zijn komen ze een voortvluchtige Alien tegen, genaamd Paul (Seth Rogen). Ze gaan samen met Paul verder op een reis die zowel hun levens als die van iedereen die op hun pad komt zal veranderen.

